import React from 'react';
import { usePageTracking } from '../../hooks/usePageTracking';

const ImageUpload = () => {
  usePageTracking(6); // ID для страницы "Инверсия изображения"

  return (
    <div className="image-upload-container">
      <h1>Инверсия изображения</h1>
      <p>Функциональность инверсии изображений будет реализована после настройки сервера.</p>
      <div style={{padding: '2rem', background: '#f5f7fa', borderRadius: '8px', textAlign: 'center'}}>
        <p>Загрузка изображений временно недоступна</p>
        <p>Сервер: http://localhost:8000/invert-image</p>
      </div>
    </div>
  );
};

export default ImageUpload;
